INSERT INTO `item_shop` VALUES (1,'2024-01-30 01:06:01.000000',NULL,'2024-01-30 01:06:01.000000','상대방의 칭호를 지정할 수 있는 아이템. 원하는 친구에게 사용이 가능하다. 아이템 구매 즉시 사용된다. 칭호는 6글자로 제한된다.','칭호 지정권',1000),(2,'2024-01-31 04:27:34.000000',NULL,'2024-01-31 04:27:34.000000','내 도감에 들어있는 게시물을 내가 선택하여 삭제하는 아이템이다. 본인의 도감에만 사용 가능하다. 아이템 구매 즉시 사용된다. 삭제된 도감은 복구가 불가능하다.','도감 삭제권',1000),(3,'2024-01-31 04:27:54.000000',NULL,'2024-01-31 04:27:54.000000','강제로 칭찬하게 만드는 아이템이다. 원하는 상대를 선택하고 멘트를 작성한다. 상대는 내가 게임 중일 때 칭찬 멘트만 작성할 수 있다.','강제 칭찬권',1000),(4,'2024-01-31 04:28:05.000000',NULL,'2024-01-31 04:28:05.000000','접속 중인 모든 유저의 화면에 원하는 멘트를 보여주는 아이템이다. 본인 또는 친구의 닉네임으로 사용이 가능하다.','확성기',1000),(5,'2024-02-08 11:21:20.000000',NULL,'2024-02-08 11:21:20.000000','도감을 추가한다.','도감추가',1000);
